ContentInfo.rightHandSide:
SEQUENCE {
   contentType        CONTENT-TYPE.
                   &id({ContentSet}),
   content            [0] EXPLICIT CONTENT-TYPE.
                   &Type({ContentSet}{@contentType})}

ContentSet.rightHandSide:
{
   --  Define the set of content types to be recognized.
   ct-Data | ct-SignedData | ct-EncryptedData | ct-EnvelopedData |
   ct-AuthenticatedData | ct-DigestedData, ... }

EncapsulatedContentInfo.rightHandSide:
SEQUENCE {
   eContentType       CONTENT-TYPE.&id({ContentSet}),
   eContent           [0] EXPLICIT OCTET STRING
           ( CONTAINING CONTENT-TYPE.
               &Type({ContentSet}{@eContentType})) OPTIONAL }

OriginatorInfo.rightHandSide:
SEQUENCE {
   certs [0] IMPLICIT CertificateSet OPTIONAL,
   crls [1] IMPLICIT RevocationInfoChoices OPTIONAL }

EncryptedContentInfo.rightHandSide:
SEQUENCE {
   contentType        CONTENT-TYPE.&id({ContentSet}),
   contentEncryptionAlgorithm ContentEncryptionAlgorithmIdentifier,
   encryptedContent   [0] IMPLICIT OCTET STRING OPTIONAL }

KeyTransRecipientInfo.rightHandSide:
SEQUENCE {
   version CMSVersion,  -- always set to 0 or 2
   rid RecipientIdentifier,
   keyEncryptionAlgorithm AlgorithmIdentifier
       {KEY-TRANSPORT, {KeyTransportAlgorithmSet}},
   encryptedKey EncryptedKey }

OriginatorIdentifierOrKey.rightHandSide:
CHOICE {
   issuerAndSerialNumber IssuerAndSerialNumber,
   subjectKeyIdentifier [0] SubjectKeyIdentifier,
   originatorKey [1] OriginatorPublicKey }

OriginatorPublicKey.rightHandSide:
SEQUENCE {
   algorithm AlgorithmIdentifier {PUBLIC-KEY, {OriginatorKeySet}},
   publicKey BIT STRING }

KeyAgreeRecipientIdentifier.rightHandSide:
CHOICE {
   issuerAndSerialNumber IssuerAndSerialNumber,
   rKeyId [0] IMPLICIT RecipientKeyIdentifier }

RecipientKeyIdentifier.rightHandSide:
SEQUENCE {
   subjectKeyIdentifier SubjectKeyIdentifier,
   date GeneralizedTime OPTIONAL,
   other OtherKeyAttribute OPTIONAL }

KEKRecipientInfo.rightHandSide:
SEQUENCE {
   version CMSVersion,  -- always set to 4
   kekid KEKIdentifier,
   keyEncryptionAlgorithm KeyEncryptionAlgorithmIdentifier,
   encryptedKey EncryptedKey }

KEKIdentifier.rightHandSide:
SEQUENCE {
   keyIdentifier OCTET STRING,
   date GeneralizedTime OPTIONAL,
   other OtherKeyAttribute OPTIONAL }

PasswordRecipientInfo.rightHandSide:
SEQUENCE {
   version CMSVersion,   -- always set to 0
   keyDerivationAlgorithm [0] KeyDerivationAlgorithmIdentifier
                           OPTIONAL,
   keyEncryptionAlgorithm KeyEncryptionAlgorithmIdentifier,
   encryptedKey EncryptedKey }

DigestedData.rightHandSide:
SEQUENCE {
   version CMSVersion,
   digestAlgorithm DigestAlgorithmIdentifier,
   encapContentInfo EncapsulatedContentInfo,
   digest Digest, ... }

EncryptedData.rightHandSide:
SEQUENCE {
   version CMSVersion,
   encryptedContentInfo EncryptedContentInfo,
   ...,
   [[2: unprotectedAttrs [1] IMPLICIT Attributes
       {{UnprotectedAttributes}} OPTIONAL ]] }

RevocationInfoChoice.rightHandSide:
CHOICE {
   crl CertificateList,
   ...,
   [[5: other [1] IMPLICIT OtherRevocationInfoFormat ]] }

ExtendedCertificateOrCertificate.rightHandSide:
CHOICE {
   certificate Certificate,
   extendedCertificate [0] IMPLICIT ExtendedCertificate }

ExtendedCertificate.rightHandSide:
SEQUENCE {
   extendedCertificateInfo ExtendedCertificateInfo,
   signatureAlgorithm SignatureAlgorithmIdentifier,
   signature Signature }

ExtendedCertificateInfo.rightHandSide:
SEQUENCE {
   version CMSVersion,
   certificate Certificate,
   attributes UnauthAttributes }

Attribute.rightHandSide:
SEQUENCE {
   attrType           ATTRIBUTE.
           &id({AttrList}),
   attrValues         SET OF ATTRIBUTE.
           &Type({AttrList}{@attrType})  }
